import React, { useState } from 'react';
import {Breadcrumb, BreadcrumbItem, Card, CardBody, Collapse} from 'reactstrap';
function GroupTableItem() {
    const [isOpen, setIsOpen] = useState(false);
    const toggle = () => setIsOpen(!isOpen);
    return (
        <div>
            <Breadcrumb>
                <BreadcrumbItem activev onClick={toggle}>{props.data.name}</BreadcrumbItem>
            </Breadcrumb>
            <Collapse  isOpen={isOpen}>
                <Card>
                    <CardBody>
                        Lorem ipsum dolor sit amet consectetur adipisicing elit. Nesciunt magni, voluptas debitis
                        similique porro a molestias consequuntur earum odio officiis natus, amet hic, iste sed
                        dignissimos esse fuga! Minus, alias.
                    </CardBody>
                </Card>
            </Collapse>


        </div>
    )

}
function GroupTable(props) {
    if(props.data.length>0){
            return <div>
                {props.data.map((value, index) => {
                    return (
                        <GroupTableItem key = {index} data={value} toggleModal = {props.toggleModal} perm={props.perm} actions={props.actions}/>
                    )
                })}
            </div>
    }else{
        return <div></div>
    }
    
}

export default GroupTable;
